import { useEffect, useState } from 'react';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";
import Fecha from './components/Fecha'
import Gasoleo from './components/Gasoleo';
import Gasolina95lz from './components/Gasolina95lz';

function App() {

  const initialUrl = 'https://sedeaplicaciones.minetur.gob.es/ServiciosRESTCarburantes/PreciosCarburantes/EstacionesTerrestres/FiltroMunicipio/'

  return (
    <Router>
      <nav className='navbar navbar-expand-lg navbar-dark bg-dark'>
        <Link to="/" className='nav-link'>Gasolina 95</Link>
        <Link to="/gasolina98" className='nav-link'>Gasolina 98</Link>
        <Link to="/gasoleo" className='nav-link'>Gasoleo</Link>
      </nav>
      <Routes>
        <Route exact path='/' element={<Gasolina95lz/>}/>
        <Route path='/gasoleo' element={<Gasoleo/>}/>
      </Routes>
    </Router>

  );
}

export default App;
